INSERT INTO `news` VALUES ('13','Vinalines  l, n ln gp nhiu ln vn iu l','Vinalines  l, n ln gp nhiu ln vn iu l','<p>B&aacute;o c&aacute;o v t&igrave;nh h&igrave;nh ti Tcty H&agrave;ng hi Vit Nam (Vinalines) ca Ch&iacute;nh  ph cho bit, giai on trc 2009, tng c&ocirc;ng ty ph&aacute;t trin tt. C&ograve;n  sau &oacute; n nay, c&oacute; mt s hn ch, yu k&eacute;m. Nh nhiu d &aacute;n chm tin  , c&ocirc;ng n ln, s n ln hn nhiu so vi vn iu l. Cui nm 2010,  t l n bng 4,27 ln vn iu l, hiu qu kinh doanh gim dn do tng  chi ph&iacute; v l&atilde;i vay, chi ph&iacute; qun l&yacute; v&agrave; khi lng ln vn u t hiu  qu thp.</p>\r\n<p>&ldquo;T 2011 bt u thua l, 4 th&aacute;ng u nm 2012 vn tip tc thua l,  t&igrave;nh h&igrave;nh t&agrave;i ch&iacute;nh ca TCty ang rt kh&oacute; khn&rdquo;&nbsp;- bn b&aacute;o c&aacute;o cp nht  nhng s liu mi nht.</p>\r\n<p>&aacute;nh gi&aacute; v nguy&ecirc;n nh&acirc;n dn n t&igrave;nh trng tr&ecirc;n, ngo&agrave;i yu t kh&aacute;ch  quan do t&igrave;nh h&igrave;nh khng hong, kh&oacute; khn n&oacute;i chung, B ch qun cho bit,  &ldquo;li&rdquo; ch quan l&agrave; do c&ocirc;ng t&aacute;c gi&aacute;m s&aacute;t, hu kim  cp b v&agrave; tng c&ocirc;ng  ty trong thi gian va qua cha c ch&uacute; trng, cha h tr cho hot  ng iu h&agrave;nh v&agrave; qun tr ca to&agrave;n TCty.</p>\r\n<p>c bit, ni b doanh nghip mt o&agrave;n kt, k&eacute;o d&agrave;i v&agrave; sai phm, ti&ecirc;u  cc trong qun l&yacute; sn xut kinh doanh. L&atilde;nh o Vinalines kh&ocirc;ng thc  hin &uacute;ng ch o ca Th tng v&agrave; c&oacute; du hiu vi phm ph&aacute;p lut trong  vic u t x&acirc;y dng nh&agrave; m&aacute;y sa cha t&agrave;u bin Vinalines ph&iacute;a Nam, g&acirc;y  thit hi v kinh t, mt s c&aacute;n b qun l&yacute; b khi t, bt tm giam nh  hng xu n uy t&iacute;n, h&igrave;nh nh ca TCty v&agrave; DNNN.</p>\r\n<p>Sau khi Thanh tra Ch&iacute;nh ph ph&aacute;t hin nhng sai phm ca Vinalines,  Th tng &atilde; y&ecirc;u cu B GTVT b&aacute;o c&aacute;o, l&agrave;m r&otilde; tr&aacute;ch nhim v vic chm  cp nht, tr&igrave;nh Th tng quy hoch ph&aacute;t trin ng&agrave;nh c&ocirc;ng nghip t&agrave;u  thy Vit Nam n 2020, nh hng n nm 2030 v&agrave; tr&aacute;ch nhim trong  vic theo d&otilde;i, gi&aacute;m s&aacute;t, kim tra u t  ni ca d &aacute;n nh&agrave; m&aacute;y sa  cha t&agrave;u bin Vinalines ph&iacute;a nam thuc TCty.</p>\r\n<p>Ni dung ph&acirc;n t&iacute;ch v tr&aacute;ch nhim cha c  cp trong b&aacute;o c&aacute;o.  Trc &oacute;, trong vn bn tr li cht vn ca i biu Quc hi v vn   n&agrave;y, B trng Thng khng nh, trong thi gian qua, B &atilde; thc hin  nghi&ecirc;m t&uacute;c tr&aacute;ch nhim ca B qun l&yacute; ng&agrave;nh i vi Vinalines.</p>\r\n<p>B trng GTVT cng nhn mnh: &ldquo;T khi th&agrave;nh lp n nay, Tng c&ocirc;ng  ty lu&ocirc;n nhn c s quan t&acirc;m, ch o s&aacute;t sao ca Th tng, c&aacute;c ph&oacute;  th tng Ch&iacute;nh ph s h tr kp thi c&oacute; hiu qu ca c&aacute;c b, ng&agrave;nh,  a phng li&ecirc;n quan, v&igrave; vy trong giai on d&agrave;i, Vinalines &atilde; ph&aacute;t  trin tt&rdquo;.</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\"><span style=\"FONT-WEIGHT: bold\">P.Tho</span></p>\r\n<p style=\"text-align: center;\"><span style=\"font-weight: bold;\"> <img alt=\"\" src=\"http://dantri4.vcmedia.vn/i:VLEfzoZuPAIveDWb3xCC/Image/2012/02/Vinalines-1_9debc/quyet-dinh-dau-tu-mua-u-noi-qua-date-cua-vinalines-de-lai-mot-khoan-lo-no-lon.jpg\" /></span></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>','2012-06-14',NULL,'1',NULL,NULL,NULL,'1');
